import React from "react";
import ReactDOM from "react-dom";
import Bootstrap from "bootstrap/dist/css/bootstrap.css";
import * as ReactBootstrap from "react-bootstrap";

const BUTTONS = ["Default", "Primary", "Success", "Info", "Warning", "Danger"];

function renderDropdownButton(title, i) {
  return (
    <ReactBootstrap.DropdownButton
      bsStyle={title.toLowerCase()}
      title={title}
      key={i}
      id={`dropdown-basic-${i}`}
    >
      <ReactBootstrap.MenuItem eventKey="1">Action</ReactBootstrap.MenuItem>
      <ReactBootstrap.MenuItem eventKey="2">
        Another action
      </ReactBootstrap.MenuItem>
      <ReactBootstrap.MenuItem eventKey="3" active>
        Active Item
      </ReactBootstrap.MenuItem>
      <ReactBootstrap.MenuItem divider />
      <ReactBootstrap.MenuItem eventKey="4">
        Separated link
      </ReactBootstrap.MenuItem>
    </ReactBootstrap.DropdownButton>
  );
}

const buttonsInstance = (
  <ReactBootstrap.ButtonToolbar>
    {BUTTONS.map(renderDropdownButton)}
  </ReactBootstrap.ButtonToolbar>
);

ReactDOM.render(buttonsInstance, document.getElementById("root"));
